import React from 'react'
import NavBar from "../components/NavBar";
import Hero from '../components/Hero';

function Home ()  {
  return (
    <>
        <NavBar/>
        <Hero
          propsName="hero"
          heroImg="https://images.unsplash.com/photo-1532453288672-3a27e9be9efd?q=80&w=1528&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"
          title=""
        
        />
        
    </>
  )
}

export default Home;
